enrolmentEligibilityCheckRule:
'use strict';
({params, imports}) => {
    const individual = params.entity;
    const moment = imports.moment;
    let eligibility = true;

    const ageGreaterThanOrEqualTo18 = new imports.rulesConfig.RuleCondition({individual}).when.ageInYears.greaterThanOrEqualTo(18).matches();

    const isFarmerBaselineDone = individual.encounters.some((enc) => enc.encounterType.name == "Family Baseline" && enc.voided == false && enc.encounterDateTime != null)

    eligibility = ageGreaterThanOrEqualTo18 && isFarmerBaselineDone;

    return eligibility;
};

'use strict';
({params, imports}) => {
    const individual = params.entity;
    const moment = imports.moment;
    let eligibility = true;

    const ageGreaterThanOrEqualTo18AndLessThanOrEqualTo65 = new imports.rulesConfig.RuleCondition({individual}).when.ageInYears.greaterThanOrEqualTo(18).and.when.ageInYears.lessThanOrEqualTo(65).matches();

    const isFarmerBaselineDone = individual.encounters.some((enc) => enc.encounterType.name == "Family Baseline" && enc.voided == false && enc.encounterDateTime != null)

    eligibility = ageGreaterThanOrEqualTo18AndLessThanOrEqualTo65 && isFarmerBaselineDone;

    return eligibility;
};
